import React, {Component} from 'react';
import './App.css';
import Todos from './components/Todos' 

class App extends Component{
  render() {
      return (
          <div className="App">
            {/* Calling the Todos component */}
            <Todos />
          </div>
        );    
  }
}

export default App;
